jupyterhub:
  proxy:
    # generate with openssl rand -hex 32
    # encrypt communications between the hub and the configurable-http-proxy
    secretToken: 
  hub:
    # database backend to use for the hub database
    db:
      url:
      password: 
    extraEnv:
      # for keycloak authenticator
      OAUTH_CALLBACK_URL: 
      OAUTH_CLIENT_ID: 
      # openssl rand -hex 32
      # to encrypt auth state
      JUPYTERHUB_CRYPT_KEY: 
    # openssl rand -hex 32
    # to sign cookies
    cookieSecret: 
  ingress:
    # List of hosts to route requests to the proxy
    hosts:
      - 
  auth:
    custom:
      # keycloak authenticator id and secret
      config:
        client_id: 
        client_secret: 
swan:
  secrets:
    # ssl termination certificate
    ingress:
      cert:
      key:
